  "description": "Hơn 30 năm trong công tác tuyển sinh du học, bằng nhiều hình thức khác nhau đã giúp đỡ CEPECE trở thành một đơn vị uy tín trong việc tuyển sinh. Nhằm tăng cường sự hợp tác giáo dục giữa Việt Nam và Ban Lan, chúng tôi cung cấp một số chương trình đại học và sau đại học phù hợp với tài chính và nguyện vọng của sinh viên Việt Nam gồm 2 trường: Đại học Tin học và Quản lý hành chính Vác-sa-va, trường đại học kinh tế Almamer Vác-sa-va.",
